import React from 'react';

const MockPracticeSection = () => {
  const quizzes = [
    {
      title: 'Technical Interview Prep',
      questions: 50,
      duration: '60 mins',
      difficulty: 'Hard',
      participants: '2.5K+'
    },
    {
      title: 'JavaScript Fundamentals',
      questions: 30,
      duration: '45 mins',
      difficulty: 'Medium',
      participants: '1.8K+'
    },
    {
      title: 'Data Structures & Algorithms',
      questions: 40,
      duration: '75 mins',
      difficulty: 'Hard',
      participants: '3.2K+'
    }
  ];

  const tips = [
    {
      icon: '📝',
      title: 'Complete Your Profile',
      description: 'Add all your skills, projects, and experiences to get better recommendations'
    },
    {
      icon: '🎯',
      title: 'Set Clear Goals',
      description: 'Define your career objectives to receive personalized opportunities'
    },
    {
      icon: '🔄',
      title: 'Regular Practice',
      description: 'Consistent practice with mock tests improves your performance'
    },
    {
      icon: '📊',
      title: 'Track Progress',
      description: 'Monitor your skill development and identify areas for improvement'
    }
  ];

  return (
    <section className="section">
      <div className="container">
        <h2 className="section-title fade-in-up">
          Practice & Improvement
        </h2>
        
        {/* Mock Practice Quizzes */}
        <div style={{ marginBottom: '4rem' }}>
          <h3 style={{
            fontSize: '2rem',
            color: '#00FFFF',
            marginBottom: '2rem',
            textAlign: 'center'
          }}>
            Mock Practice Quizzes
          </h3>
          <div className="grid grid-cols-3">
            {quizzes.map((quiz, index) => (
              <div 
                key={quiz.title}
                className="card holographic"
                style={{ animationDelay: `${index * 0.1}s` }}
              >
                <h4 style={{
                  color: 'white',
                  fontSize: '1.25rem',
                  marginBottom: '1rem',
                  textAlign: 'center'
                }}>
                  {quiz.title}
                </h4>
                
                <div style={{
                  display: 'grid',
                  gridTemplateColumns: '1fr 1fr',
                  gap: '0.5rem',
                  marginBottom: '1.5rem'
                }}>
                  <div style={{ textAlign: 'center' }}>
                    <div style={{ color: '#00FFFF', fontSize: '0.9rem' }}>Questions</div>
                    <div style={{ color: 'white', fontWeight: '600' }}>{quiz.questions}</div>
                  </div>
                  <div style={{ textAlign: 'center' }}>
                    <div style={{ color: '#00FFFF', fontSize: '0.9rem' }}>Duration</div>
                    <div style={{ color: 'white', fontWeight: '600' }}>{quiz.duration}</div>
                  </div>
                  <div style={{ textAlign: 'center' }}>
                    <div style={{ color: '#00FFFF', fontSize: '0.9rem' }}>Difficulty</div>
                    <div style={{ color: 'white', fontWeight: '600' }}>{quiz.difficulty}</div>
                  </div>
                  <div style={{ textAlign: 'center' }}>
                    <div style={{ color: '#00FFFF', fontSize: '0.9rem' }}>Participants</div>
                    <div style={{ color: 'white', fontWeight: '600' }}>{quiz.participants}</div>
                  </div>
                </div>
                
                <button className="btn-primary" style={{ width: '100%' }}>
                  Start Quiz
                </button>
              </div>
            ))}
          </div>
        </div>
        
        {/* Profile Enhancement Tips */}
        <div>
          <h3 style={{
            fontSize: '2rem',
            color: '#00FFFF',
            marginBottom: '2rem',
            textAlign: 'center'
          }}>
            How to Enhance Your Profile
          </h3>
          <div className="grid grid-cols-4">
            {tips.map((tip, index) => (
              <div 
                key={tip.title}
                className="card holographic"
                style={{ 
                  textAlign: 'center',
                  animationDelay: `${index * 0.1}s`
                }}
              >
                <div style={{
                  fontSize: '3rem',
                  marginBottom: '1rem'
                }}>
                  {tip.icon}
                </div>
                <h4 style={{
                  color: 'white',
                  fontSize: '1.1rem',
                  marginBottom: '0.5rem'
                }}>
                  {tip.title}
                </h4>
                <p style={{
                  color: '#00BFFF',
                  fontSize: '0.9rem',
                  lineHeight: '1.4'
                }}>
                  {tip.description}
                </p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
};

export default MockPracticeSection;
